import './Calender.css';
import MuunganoDAte from './Date';
import MuunganoMoney from './Muungano/Main';


// Calender Main Component
export default function ReturnCalendeR() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-calender-actif'>
  <View />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-calender-actif-sm'>
  <View />
 </div>
);
export const View = () => (
 <>
  <MuunganoDAte />
  <MuunganoMoney />
 </>
);
